import React from "react";

function Timp({ time }) {
  return (
    <>
      Timp trecut: {time.h >= 10 ? time.h : "0" + time.h}: {time.m >= 10 ? time.m : "0" + time.m}: {time.s >= 10 ? time.s : "0" + time.s}
    </>
  );
}

export default Timp;
